INSERT INTO `wp_wc_admin_notes` VALUES (2,'wc-admin-historical-data','update','en_US','WooCommerce Admin: Historical Analytics Data','To view your historical analytics data, you must process your existing orders and customers.','info','{}','unactioned','woocommerce-admin','2019-07-15 10:15:41',NULL,0),(3,'wc-admin-welcome-note','info','en_US','New feature(s)','Welcome to the new WooCommerce experience! In this new release you\'ll be able to have a glimpse of how your store is doing in the Dashboard, manage important aspects of your business (such as managing orders, stock, reviews) from anywhere in the interface, dive into your store data with a completely new Analytics section and more!','info','{}','unactioned','woocommerce-admin','2019-07-15 10:15:41',NULL,0),(4,'wc-admin-wc-helper-connection','info','en_US','Connect to WooCommerce.com','Connect to get important product notifications and updates.','info','{}','unactioned','woocommerce-admin','2019-07-15 10:15:42',NULL,0),(5,'wc-admin-mobile-app','info','en_US','Install Woo mobile app','Install the WooCommerce mobile app to manage orders, receive sales notifications, and view key metrics  wherever you are.','phone','{}','unactioned','woocommerce-admin','2019-07-17 16:02:44',NULL,0),(6,'wc-admin-store-notice-giving-feedback','info','en_US','Giving feedback','Are you enjoying the new WooCommerce experience? We\'d love to get your feedback.','info','{}','unactioned','woocommerce-admin','2019-07-19 02:02:04',NULL,0),(7,'wc-admin-orders-milestone','info','en_US','Congratulations on processing 10 orders!','You\'ve hit the 10 orders milestone! Look at you go. Browse some WooCommerce success stories for inspiration.','trophy','{}','unactioned','woocommerce-admin','2019-10-21 14:29:22',NULL,0);
